import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() { //JSX
    return (
        <div className="App">
            <nav className="navbar navbar-dark bg-dark">

            </nav>
            <img src={logo} className="App-logo" alt="logo" />
        </div>
    );
}

export default App;
